import React, { useEffect } from 'react';
import styled from 'styled-components';
import PostBox from '../components/SenderPage/PostBox';
import CenterView from '../components/publicComponents/CenterView';
import Container from '../components/publicComponents/Container';
import { usePost } from '../Hooks/usePost';

const SenderPage: React.FC = () => {

    const post = usePost();

    useEffect(() => {
        post.getSentPosts();
    }, []); //eslint-disable-line

    return (
        <Container>
            <CenterView>
                    <Row>
                        <PostBox sentPosts={post.sentPosts}
                                 onClick={post.showSentOne}
                                 content={post.currentPost?.content}
                                 toAccount={post.currentPost?.toAccount}
                                 />
                    </Row>
            </CenterView>
        </Container>
    )
}

export default SenderPage;

const Row = styled.div`
    min-width: 100%;
    max-width: 100%;
    height: 100%;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: center;
`;
